import React, { Fragment, Component } from 'react';

import Header from 'components/shared-components/header';
import GridList from 'components/grid-list';
import SearchPanel from 'components/search-panel';
import TableBookBar from 'components/table-book-bar'

import './restaurant-page.css'

import restaurants from 'api/mock-restaurants';

import { withStyles } from '@material-ui/core/styles';
import PropTypes from 'prop-types';

const styles = theme => ({
  input: {
    flexGrow: 2,
  },
  contentRoot: {
    display: "flex",
  },
  filterBar: {
    display: "flex",
    justifyContent: "center",
    width: '60rem',
    marginBottom: "1.5rem"
  }
});

const navItems = [
  {label: 'Join us'},
  {label: 'Contact'},
  {label: 'Login'},
  {label: 'Registration'}
];

class RestaurantPage extends Component {

  render()
    {
      const { classes } = this.props;
      return (
        <div>
          <Header navItems={ navItems } />
          <div >
            <div className={classes.filterBar}>
              <SearchPanel className={classes.input}/>
              <TableBookBar />
            </div>
            <GridList data={ restaurants }/>
          </div>
        </div>
      );
    }
};

RestaurantPage.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(RestaurantPage);
